Íñigo Errejón: 'Julio Rodríguez nos ayuda a llegar a la gente que puede recelar de nosotros'

El Gobierno destituye al general de Podemos con deshonor
'Forcadell no ha cumplido el mandato para el que le votaron nuestros diputados'
"Empezamos a respirar un aire de remontada", asegura a EL MUNDO Íñigo Errejón, director de campaña de Podemos, que quita importancia a los últimos datos del CIS señalando que "han nacido envejecidos" [consulte el Barómetro en PDF]. Según Errejón, su formación pudo equivocarse al transmitir "eslóganes agresivos" y mensajes "que pudieron sonar demasiado duros... Hay que encontrar el punto medio", insiste.
El número dos de Podemos se ha encontrado en los últimos dos años en circunstancias que nunca imaginó como doctor en Ciencias Políticas. La última, que se le cuadre un general del Ejército poniéndose a sus órdenes como director de la campaña electoral de su formación.
El lenguaje, los gestos, las formas, se han ido edulcorando tanto con el transcurrir de los meses y de los resultados (adversos) de las encuestas, que me recuerdan cada vez más a la frase de Groucho Marx: "Estos son mis principios... Pero si no le gustan tengo otros".
Decías lo que pensabais de verdad. Ahora, como veis que no os conviene, queréis contar milongas, pero ya os hemos descubierto. Que os vaya bonito, jeje
