Todo Dictador, necesita un general.
Empezaron con eso de la "casta", el "bipartidismo", el "enchufismo", el dar casa a los desahuciados. Y ahora fichan a los de la "casta", el "bipartidismo", el "enchufismo", y los que formaron parte de los desahuciadadores. Ya lo he dicho en otro comentario: Lo próximo es fichar a un cura. ¿Que nadie se lo cree?. Como todos veréis, ni un sólo especimen de esta desgracia social, dice nada al respecto.
