@mlucas7 #229Cerrar@ marcrenton # 218 No sé quién tendrá la solución, pero siempre preferiré el mal menor a Podemos, que es como Groucho Marx, "si no le gustan mis principios tengo otros." Estos cambian una semana para otra de propuestas, no saben a dónde van. Viven de ocurrecias que no ayudan a crear trabajo o solucionar los problemas de la gente corriente. El voto es secreto y, si en este país la gente se avergüenza a la derecha es porque la izquierda se ha abrogado la posesión de la verdad y la honradez, cosa que es mentira. Y no soy de derechas, ni de izquierdas, voto a las personas. esta usted muy equivocado, quien se a auto impuesto la posesión de la verdad absoluta es la derecha y la usa como su mayoría absoluta, mal y abusivamente , en podemos no se actúa para nada así pues cada decisión es sometida a voto y concenso entre los afiliados tras un proceso democrático entre ciudadanos que tienen diferentes ideologías, lo,que usted llama medidas de maquillaje es el no haberse interesado para nada sobre el buen hacer en ayuntamientos, y no los confunda con intensiones de mayor calado que sobrepasan las competencias municipales, pues ya se encarga el PP de elaborar mentiras para el descrédito. En cuanto lo de que usted vota a personas es ridículo, pues bien que critica a formaciones, es una lástima que tenga que avergonzarse de su voto
