@marcrenton #219Cerrar@ mlucas7 # 212 no será que usted no se ha molestado en interesarse por lo que podemos hace? si fueran vacíos de contenido la vicepresidenta y el PP en general no tendría reparos en nombrarlos en las ruedas de prensa por su nombre, pero por algo les temen y hacen tanta campaña de desprestigio, saben perfectamente que tienen soluciones y reformas muy válidas y que el PP muchas cosas que esconder De momento, en los ayuntamientos que gobiernan (gracias a los votos de PSOE al que tanto desprecian) sólo han tomado medidas "maquillaje" que, además muchas veces son sectarias. No me convencen ni sus amigos ni ellos. Lo siento, pero con mi voto NO GOBERNARÁ PODEMOS.
En general, estoy encantado con los jóvenes que representan a los partidos que solicitan el voto de los españoles....Confío en ELLOS, a fin de que España termine de ganar la altura perdida, debido a la crisis, a las ganas de revancha de los conservaduros (Casi se cargan el Estado del Bienestar), y todo ello, a pesar de que JAMÁS nos hemos acercado a los países más avanzados..... Así, con jubilados perdiendo poder adquisitivo, autónomos en decadencia (Con sueldos de miseria, nadie compra nada y las fábricas se hunden), lo que ha provocado el cierre de MILES DE EMPRESAS, con la consecuencia de la pérdida de CIENTOS DE MILES DE PUESTOS DE TRABAJO....Y las políticas erróneas de ayudar a la banca mala, perdonar a los defraudadores fiscales y otros errores graves.... Así, la solución a estos desvaríos, podría empezar el 21D....Con moderación, centrismo y firmeza...
