@Pensadora #123Cerrar@ dejerez # 93 Yo voté a podemos en las europeas y les he seguido votando y les votaré si no cambia la cosa en las generales. No soy antisistema, sea eso lo que sea, desde luego si es estar en contra de un sistema organizado de robo de dinero público entonces sí, lo soy. Pero dudo que nadie que me conozca me califique así, soy bastante "clásica" en general. Dos licenciaturas, un máster, una carrera profesional bastante estable afortunadamente, buen sueldo y con mucho contacto y viajes fuera de España. Soy una afortunada totalmente consciente de mi suerte. Y por cierto, he tenido en mis inicios montones de trabajos que aquí algunos desprecian, como camarera, clases particulares, canguro, dependienta, etc. Y por supuesto somos muchos los que nos hemos ganado la vida honradamente, tenemos unos estudios y una experiencia y votamos a podemos. Sigan insultándonos, es lo único que llevan haciendo año y medio. Saludos pensadora. Lo primero que me gustaría aclarar es que yo no he insultado a nadie, tan sólo me he limitado a expresar libremente mi opinión. Ahí queda mi comentario como prueba. En segundo lugar, comentarle que curriculum vitae como el suyo hay millones, pero que nada tienen que ver con lo que estamos discutiendo. No califico a quien vota (cada uno es libre de votar a quien le de la gana, faltaría más) sino que sólo califico a quien pide el voto. Y en este caso critico que Podemos ha pasado de ser un partido de izquierda pura (así lo han dicho ellos, no yo), con el objetivo de cargarse el actual sistema económico-social, y en especial de acabar con el PPSOE, y ahora quieren aparentar ser de centro derecha, y sin que sea necesario salir a la calle a la caza de los fachas del PP, ni tampoco cargarse la economía libre de mercado. Por eso sigo pensando que se trata de otro partido el que nos quieren vender ahora, y tan sólo para captar votos de quien no es radical.
